import React, { useEffect, useState, useRef } from 'react';
import { useParams, Link } from 'react-router-dom';
import './VenuePage.css';


const VenuePage = () => {
  const { id } = useParams();
  const [venues, setVenues] = useState([]);
  const [loading, setLoading] = useState(true);
  const effectRan = useRef(false);

  useEffect(() => {
    if (effectRan.current === false) {
      const venueload = async () => {
        try {
          const response = await fetch('http://localhost:5000/shop/loadvground', { 
            credentials: 'include'
          });
          console.log('hi');
          if (response.ok) {
            const data = await response.json();
            console.log('Fetched Data:', data);

            if (Array.isArray(data) && data.length > 0) {
              setVenues(data);
            } else {
              console.warn('Fetched data is not in expected format:', data);
            }
          } else {
            console.error('Failed to load venues:', response.statusText);
          }
        } catch (error) {
          console.error('Error fetching venues:', error);
          alert('An error occurred while fetching venues.');
        } finally {
          setLoading(false);
        }
      };

      venueload();
      effectRan.current = true;
    }

    return () => {
      effectRan.current = true; // Cleanup to prevent double fetch in strict mode
    };
  }, []);

  if (loading) {
    return <div>Loading venues...</div>; // Display loading message while fetching
  }

  // Find the venue based on the id parameter from the URL
  const venue = venues.find(v => v.id === parseInt(id));
  if (!venue) {
    return <h2>Venue not found</h2>;
  }

  return (
    <div className="venue-page">
      <div className="content">
        <VenueDetails
          name={venue.name}
          location={venue.location}
          image={venue.image}
          rating={venue.rating}
          ratingCount={venue.ratingCount}
          timing={venue.timing}
          facilities={venue.facilities}
          sports={venue.sports}
          pricePerHour={venue.pricePerHour}
        />
        <div className="side-info">
          <BookingInfo pricePerHour={venue.pricePerHour} />
          <MapLocation
            address={venue.address}
            mapUrl={venue.mapUrl}
          />
        </div>
      </div>
    </div>
  );
};

const VenueDetails = ({ name, location, image, rating, ratingCount, timing, facilities, sports, pricePerHour }) => {
  return (
    <div className="venue-details">
      <h2>{name}</h2>
      <p>{location} · ⭐ {rating} ({ratingCount} ratings) <Link to="#">Rate Venue</Link></p>
      <img src={require(`../assets/${image}`)} alt={name} className="venue-image" />
      <div className="venue-info">
        <h4>Timing</h4>
        <p>{timing}</p>
        <h4>Facilities</h4>
        <ul>
          {facilities.map((facility, index) => (
            <li key={index}>{facility}</li>
          ))}
        </ul>
        <h4>Sports</h4>
        <ul>
          {sports.map((sport, index) => (
            <li key={index}>{sport}</li>
          ))}
        </ul>
        <h4>Price</h4>
        <p>₹{pricePerHour} per hour</p>
      </div>
    </div>
  );
};

const BookingInfo = ({ pricePerHour }) => {
  return (
    <div className="booking-info">
      <h3>Book Now</h3>
      <p>Price: ₹{pricePerHour} per hour</p>
      <button className="book-now">Book Now</button>
      <div className="button-group">
        <button className="share"><i className="fas fa-share-alt"></i> Share</button>
        <button className="bulk-corporate">Bulk / Corporate</button>
      </div>
    </div>
  );
};

const MapLocation = ({ address, mapUrl }) => {
  return (
    <div className="map-location">
      <h4>Location</h4>
      <p>{address}</p>
      <iframe src={mapUrl} width="400" height="300" allowFullScreen="" loading="lazy" title="Venue Location"></iframe>
    </div>
  );
}

export default VenuePage;
